import axios from 'axios';
import React from 'react';
import { useEffect } from 'react';

export default function Mainpage() {
  useEffect(() => {
    axios
      .post(
        'http://localhost:8000/getallusers',
        { ksdhf: 'dsafkk' },
        {
          headers: {
            'Test-Header': 'test-value',
          },
        }
      )
      .then((res) => {
        console.log(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  return <div>hrl</div>;
}
